import React, { Component } from 'react';
import "bulma/css/bulma.css";
import '../MainPage.css';
import { Route } from "react-router";

class About extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div class="card column is-three-fifths is-offset-one-fifth" style={{borderRadius:"25px",marginTop:"15%",boxShadows: "10px 10px",backgrounda: "linear-gradient(90deg, rgba(21,18,74,1) 0%, rgba(108,9,121,1) 100%, rgba(33,115,72,1) 100%)"}}>

        <div className = "card" style={{margin:"5%",boxShadow: "0px 0px 0px",borderRadius:"25px"}}>
          <div class="columns">

            <div class="column" style-={{padding:"10%"}}>
                  <div class="title is-3">
                  Questions or Feedback?
                  <div>
                  Contact me!
                  </div>
                  </div>
                  <hr style={{border:"1px solid black"}}/>
                  <span class="icon" style={{float:"left"}}>
                    <img class="is-rounded"src={Phone} alt="Placeholder image"/>
                  </span>
                  <div class="subtitle is-5">
                    <div class="title is-5" style={{float:"left", marginRight:"2%",  marginLeft:"2%"}}>
                      Phone:
                    </div>
                    978-270-4538
                  </div>
                  <span class="icon" style={{float:"left"}}>
                    <img class="is-rounded"src={Email} alt="Placeholder image"/>
                  </span>
                  <div class="subtitle is-5">
                  <div class="title is-5" style={{float:"left", marginRight:"2%",  marginLeft:"2%"}}>
                    Email:
                  </div>
                  brendmm@vt.edu
                </div>
            </div>

          </div>
        </div>

      </div>
    );
  }
}

export default About;
